function lengthOfLongestSubstring(s: string): number {
  // const start = performance.now()
  if (s.length === 0) return 0
  let queue: string[] = []
  queue = s.split('')
  let successNums: number[] = []
  let scanLength = 1
  while (queue.length >= scanLength) {
    // 根据扫描长度去除对应长度的字符串
    const target = queue.slice(0, scanLength)
    const set = new Set(target)
    if (set.size === scanLength) {
      //匹配成功
      successNums.push(scanLength)
      scanLength++
      set.clear()
    } else {
      //匹配失败
      set.clear()
      queue.shift()
    }
  }
  // const end = performance.now()
  // console.log(end - start)

  return successNums[successNums.length - 1]
}
